import React from "react";
import Navbar from "../components/Navbar";
import '../pages/Profile.css';
import  ProfileSlider from "../components/ProfileSlider";
import ProfileCard from '../components/ProfileCard';

function Profile() {
  return (
      <div className="grid-container">
        <div className="student-details"></div>
        <div className="your-projects">
          <h1 className="profile-heading">Your &nbsp;Projects</h1>
          {/* <ProfileSlider/> */}
          <div>
            <ProfileCard/>
            <ProfileCard/>
          </div>
        </div>

        <div className="your-collaborations">
          <h1 className="profile-heading">Your &nbsp;Collaborations</h1>
          {/* <ProfileSlider/> */}
          <div>
            <ProfileCard/>
            <ProfileCard/>
          </div>
        </div>

        <div className="Collections">
          <h1 className="profile-heading">Collections</h1>
          {/* <ProfileSlider/> */}
          <div>
            <ProfileCard/>
            <ProfileCard/>
          </div>
        </div>
      </div>
  );
}

export default Profile;
